var gui; 

var equip = [];
var eco = [];
var flagall = []; 

var nameP;

for(var i in data)
{
    //document.write(data[i]+" ");
    corr = spearson.correlation.spearman(x, data[i]);
    
    if(corr<=0)
    {
        flag = 1; 
        count_n++;
        flagall.push(flag);    
    }
    else
    {
        flag = 0;
        count_p++; 
        flagall.push(flag);
    }
    
    corr = 1/(Math.abs(corr));
    //document.write(corr+ " ");
    equip.push(i);
    eco.push(corr);
}

